def can_reach_target(N, K, A):

    def gcd(x, y):
        while y:
            (x, y) = (y, x % y)
        return x
    z = max(A)
    for i in A:
        z = gcd(z, i)
    if max(A) >= K or K % z == 0:
        return 'POSSIBLE'
    else:
        return 'IMPOSSIBLE'

